INSERT INTO `app_settings` (`about_id`, `app_name`, `app_description_sort`, `app_description_full`, `phone_number`, `whatsapp_number`, `email`, `address`, `app_logo`, `app_favicon`, `app_version`, `app_help`) VALUES
(1, 'Bima Finance', 'Lorem ipsum', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum', '6283815613839', '6283815613839', 'contact@gmail.com', 'jalan Sama Aku, Nikah Sama Dia\r\nJawa Barat, Indonesia', 'logo.png', 'favicon.png', 'v1.0.0', '<p><strong>CARA CHECKOUT<br /><br /></strong>Sangat mudah untuk menyelesaikan pemesanan di halaman checkout dan mengakhiri kunjungan belanja online Anda. Jika Anda telah mendaftarkan email Anda di adidas, atau membuat akun di store kami sebelumnya, Anda dapat menggunakan email Anda untuk login. Jika tidak, Anda dapat melakukan checkout sebagai guest atau membuat akun. Dengan memiliki akun, Anda akan dapat mengakses fitur yang praktis seperti daftar alamat dan riwayat pesanan pribadi Anda.</p> <p>Anda akan diminta memasukkan alamat pengiriman dan penagihan dalam dua langkah pertama saat checkout. Jika alamat penagihan Anda sama dengan alamat pengiriman, cukup beri tanda centang pada kotak, maka alamat penagihan akan terisi secara otomatis. Jika Anda telah menyimpan alamat di proses checkout sebelumnya, Anda juga dapat menggunakan daftar alamat untuk memilih alamat tersebut.</p> <p>Selanjutnya adalah informasi pembayaran. Setelah memasukkan semua data Anda di halaman ini dan mengklik lanjutkan, transaksi pembayaran tidak akan langsung diproses sebelum Anda mengonfirmasi order di halaman selanjutnya. Perhatikan bahwa untuk memastikan keamanan data Anda, data kartu kredit Anda tidak akan disimpan di sistem.</p> <p>Jika informasi pembayaran Anda sudah lengkap, halaman yang menampilkan pesanan Anda akan muncul. Harap periksa semua informasi di halaman ini, karena ini kesempatan terakhir Anda untuk melakukan koreksi. Setelah menekan &lsquo;Konfirmasi Pesanan&rsquo;, pesanan Anda akan diproses dan dikirim ke gudang. Setelah itu, Anda dapat mengecek status pesanan tersebut di akun Anda</p> <p>&nbsp;</p> <p><strong>AKUN SAYA</strong></p> <p>Profil adalah halaman di mana Anda dapat mengakses semua informasi Anda. Anda juga dapat mengelola daftar alamat, menentukan newsletter subscription dan melihat riwayat pesanan Anda.</p> <p><strong>Informasi Akun</strong><br />Di halaman ini Anda dapat mengubah email dan kata sandi Anda. Informasi yang Anda masukkan dikombinasikan dengan informasi yang Anda masukkan di halaman newsletter untuk dapat mengirimkan infomasi khusus mengenai peluncuran, penawaran produk, dll. Tentu Anda tidak akan menerima informasi ini jika Anda belum melakukan sign up newsletter.</p> <p><strong>Newsletter</strong><br />Di bagian ini Anda dapat melakukan sign up untuk menerima newsletter adidas dan menentukan topik mengenai info terbaru yang Anda inginkan. Anda juga dapat berhenti berlangganan newsletter di sini.</p> <p><strong>Daftar Alamat</strong><br />Di daftar alamat, Anda memiliki opsi untuk mengelola sejumlah alamat yang nanti dapat memudahkan dan mempercepat proses checkout Anda. Jika Anda menentukan suatu alamat sebagai alamat rumah Anda, alamat tersebut akan langsung terpilih saat proses checkout Anda berikutnya. Saat Anda melakukan checkout, Anda dapat memilih untuk menyimpan alamat di daftar alamat untuk penggunaan selanjutnya.</p> <p><strong>Riwayat Pesanan</strong><br />Di bagian ini Anda dapat meninjau semua pesanan adidas yang Anda lakukan sebelumnya, dan juga mengecek pesanan terbaru. Silakan baca help topic &ldquo;Cek Pesanan Anda&rdquo; untuk mengetahui statusnya.</p>');
