(1, 'MARKETING HEAD', '<p>Kualifikasi :</p>\r\n<ol>\r\n    <li>Pria</li>\r\n    <li>Pendidikan minimal D3/ S1 semua jurusan</li>\r\n    <li>Usia maksimal 35 tahun</li>\r\n    <li>Berpengalaman sebagai Marketing Head/ Coordinator pada perusahaan pembiayaan atau perbankan</li>\r\n    <li>Memiliki kemampuan analisa yang sangat baik</li>\r\n    <li>Berintegritas dan mampu beradaptasi dalam waktu yang cepat</li>\r\n    <li>Memiliki supervisory skill dan mampu bekerja secara team</li>\r\n</ol>', 1, 99, '2021-12-11 21:21:56', 99, '2021-12-11 21:20:47'),
(2, 'OPERATION HEAD', '<p>Kualifikasi :</p>\r\n<ol>\r\n    <li>Pria/ wanita</li>\r\n    <li>Pendidikan minimal D3 semua jurusan</li>\r\n    <li>Single/ usia maksimal 35 tahunBerpengalaman sebagai Operation Head, Adm Head, Adm Coordinator pada perusahaan pembiayaan Konsumen, Perbankan selama 2 tahun</li>\r\n    <li>Pekerja keras dengan attitude yang baik dan loyalitas tinggi</li>\r\n    <li>Mampu bekerja secara team</li>\r\n</ol>', 1, 99, '2021-12-11 21:21:56', 99, '2021-12-11 21:20:47');
