INSERT INTO `news` (`news_id`, `news_title`, `news_description`, `news_images`, `is_active`, `created_by`, `created_date`, `updated_by`, `updated_date`) VALUES
(1, '1ST SEMESTER MEETING 2015', '<p>Pada tanggal 7 Juli 2015 bertempat di Ballroom Hotel IBIS Harmoni, Jakarta. Telah sukses dilaksanakan rapat semester pertama Bima Finance. Rapat semester pertama yang bertema &lsquo;Do The Best With Integrity&rsquo; diikuti oleh seluruh pimpinan manajemen baik dari pusat maupun cabang.</p>\r\n<p>Rapat semester pertama merupakan semangat Bima Finance untuk menjadi lebih baik kedepannya, dengan meningkatkan integritas dari mutu kinerja, sumber daya manusia dan kualitas penjualan.</p>\r\n<p>Dalam rapat tersebut membahas tentang laporan pergerakkan penjualan selama semester pertama dan diikuti pula pemberian penghargaan bagi para pemenang dari kontes kategori untuk semua unit bisnis terbaik yang telah dipertandingkan.</p>', , 1, 99, '2015-07-15 01:26:05', 99, '2015-07-15 01:26:05');
INSERT INTO `news` (`news_id`, `news_title`, `news_description`, `news_images`, `is_active`, `created_by`, `created_date`, `updated_by`, `updated_date`) VALUES
(2, '2ND SEMESTER MEETING 2015', '<p>Bima Finance telah menyelesaikan tahun kerja 2015, sejalan dengan itu pada saat lalu manajemen Bima Finance mengadakan acara evaluasi kerja 2015 dan pencanangan rencana kerja tahun 2016 di Hotel NEO+ Green Savana, Sentul. Acara diikuti oleh para Dewan Komisaris, para Dewan Direksi, seluruh General Manager dan para Manager HO serta seluruh Area Manager Marketing, Operation, Collection se-Nasional.</p>\r\n<p>Acara diawali dengan pemaparan hasil kerja yang disampaikan oleh Bapak Djuanda Setiawan sebagai Direktur, kemudian diikuti dengan pembahasan dari setiap divisi dan area yang menghadiri rapat tersebut. Rapat semester kedua membuahkan hasil komitmen dan target kerja 2016 yang akan digunakan sebagai rencana kerja di masing-masing cabang yang ada. Selain itu juga, acara tersebut menjadi sarana diskusi dan saling berbagi ilmu baik bidang operasional maupun hal-hal mengenai marketing.</p>\r\n<p>Acara pertemuan tersebut ditutup dengan sambutan motivatif dari Bapak Eddy Edgar Hartono sebagai Komisaris Utama, sambutan inspiratif dari Ibu Wina Ratnawati sebagai Direktur Utama dan diakhiri oleh Bapak Halim Gunadi yang memberikan cara untuk pencapaian target melalui yel-yel yang mudah diingat. Dalam kesempatan yang sama acara diteruskan dengan seminar motivasi yang dibawakan oleh Coach Tom Mc Iffle sebagai penambah semangat bekerja Bima Finance di awal tahun 2016.</p>', , 1, 99, '2015-07-15 01:26:05', 99, '2015-07-15 01:26:05');
